sys_variable_value.value:
(function execute(inputs, outputs) {
    try {
        inputs = new JenkinsUtils().trimStringInputs(inputs);
        inputs.destination_job_path = inputs.destination_job_path.replace(
            /^\/|\/$/g, '');
        inputs.source_job_path = inputs.source_job_path.replace(/^\/|\/$/g,
            '');
        outputs.source_job_path = inputs.source_job_path;
        if (inputs.destination_job_path.includes("/")) {
            outputs.destination_job_path = inputs.destination_job_path
                .split("/").pop();
            var target_folder = "";
            target_folder = inputs.destination_job_path.substring(0, inputs
                .destination_job_path.lastIndexOf('/'));
            outputs.target_folder = target_folder;
            if (target_folder.includes("/")) {
                var job_path = "";
                var parent_jobs = target_folder.split('/');
                for (var i = 0; i < parent_jobs.length; i++) {
                    job_path += "/job/" + parent_jobs[i];
                }
                outputs.target_path = job_path.toString();
            } else {
                outputs.target_path = "/job/" + target_folder.toString();
            }
        } else
            outputs.destination_job_path = inputs.destination_job_path;
    } catch (e) {
        new JenkinsUtils().throwError('copy_job');
    }

})(inputs, outputs);

